import { Helmet } from "react-helmet";
import { NOMBRETIENDA } from "../../assets/js/CONST";
import Carrusel from "../../components/Carrusel/Carrusel";
import "./Inicio.css";

function Inicio() {
	return (
		<>
			<Helmet>
				<title>Bienvenido || { NOMBRETIENDA }</title>
				<meta property="og:image" content="%PUBLIC_URL%/vistetebella1200x628.jpg" />
				<meta property="twitter:image" content="%PUBLIC_URL%/vistetebella1200x628.jpg" />
			</Helmet>
			<section id="inicio">
				<Carrusel />
			</section>
		</>
	);
}
export default Inicio;
